        if ((len >= minSize) && (len < maxSize)) {
          return true;
        }

        if (len == maxSize) {
          for (i = 0; i < maxSize; i++) {
            if (isHexaDigit(val.charAt(i)) == false) {
              return false;
            }
          }
          return true;
        }

        return false;
      }

