      function isValidWPAPskKey(val) {
        var len = val.length;
        var maxSize = 64;
        var minSize = 8;

        if (isValidAscii(val) != '') {
          return false;
        }

        if ((len >= minSize) && (len < maxSize)) {
          return true;
        }

        if (len == maxSize) {
          for (i = 0; i < maxSize; i++) {
            if (isHexaDigit(val.charAt(i)) == false) {
              return false;
            }
          }
          return true;
        }

        return false;
      }

