        if (!CompareString(str, Username.value)) {
          return false;
        }

        if (isLowercaseInString(str)) {
          i++;
        }

        if (isUppercaseInString(str)) {
          i++;
        }

        if (isDigitInString(str)) {
          i++;
        }

        if (isSpecialCharacterNoSpace(str)) {
          i++;
        }

        if (i >= 2) {
          return true;
        }
        return false;
