      function isValidAscii(val) {
        for (var i = 0; i < val.length; i++) {
          var ch = val.charAt(i);
          if (ch <= ' ' || ch > '~') {
            return false;
          }
        }
        return true;
      }

      function isLowercaseInString(str) {
        var lower_reg = /^.*([a-z])+.*$/;
        var MyReg = new RegExp(lower_reg);
        if (MyReg.test(str)) {
          return true;
        }
        return false;
      }

      function isUppercaseInString(str) {
        var upper_reg = /^.*([A-Z])+.*$/;
        var MyReg = new RegExp(upper_reg);
        if (MyReg.test(str)) {
          return true;
        }
        return false;
      }

      function isDigitInString(str) {
        var digit_reg = /^.*([0-9])+.*$/;
        var MyReg = new RegExp(digit_reg);
        if (MyReg.test(str)) {
          return true;
        }
        return false;
      }

      function isSpecialCharacterNoSpace(str) {
        var specia_Reg = /^.*[`~!@#\$%\^&\*\(\)_\+\-=\[\]\{\}\'\;\,\./:\"\?><\\\|]{1,}.*$/;
        var MyReg = new RegExp(specia_Reg);
        if (MyReg.test(str)) {
          return true;
        }
        return false;
      }

