        Password.disabled = true;

        if ((CfgMode.toUpperCase() == 'TOT') || (CfgMode.toUpperCase() == 'THAILANDNT2')) {
          Form.addParameter('CheckCode', getValue('VerificationCode'));
          Form.setAction('login.cgi?' + '&CheckCodeErrFile=login.asp');
